import Room from "../rooms/Room"
import { room1 } from "./../../src/image/index"

export default function Board() {

    return (
        <div style={{backgroundColor: '#FFFFFF', width: '100%', height: '90%', position: "absolute"}}>
            <Room room={room1} />

        </div>
    )


}
